(1904, 'chatfino''', 'chaht-fee-noo''', 'noun. profanity; blasphemy; cursing; swearing; foul language; foul talk. verb. to curse; to swear; to use foul language; to use offensive language.', 'From Chamorro prefix chat- (to be deficient in, lacking) + fino'' (speech). Literally, improper speech.', STRINGDECODE('Chumachatfino'' si Antonio. Antonio is cursing. Chatfino'' este i pal\u00e5bra \"diapblu\". This word \"diapblu\" is an obscenity.'), NULL, TIMESTAMP '2020-12-14 15:18:17.34266', TIMESTAMP '2020-12-14 15:18:17.471308'),
(1905, 'chatfinu''i', 'chaht-fee-noo''-ee', 'verb. to swear at someone; curse at; to cuss at someone; blaspheme at.', 'From Chamorro chatfino'' (to swear, curse) + i (object focus)', STRINGDECODE('Chinatfinu''i ni palao''an sa'' ti ha u''usa i tampen fasu-\u00f1a. He was cussed out by the woman, because he wasn''t wearing his face mask.'), NULL, TIMESTAMP '2020-12-14 15:18:17.34266', TIMESTAMP '2020-12-14 15:18:17.471308'),
