(1907, 'chatge', 'chaht-gee', 'verb. to laugh at someone -- for being funny; laugh at someone by mocking; laugh at someone showing friendship, kindness, gratitude.', STRINGDECODE('Contraction of chaliki, from Chamorro ch\u00e5lek (laugh) + i (object focus).'), STRINGDECODE('Munga machatge yu''. Don''t laugh at me. Ha chachatge i bab\u00e5-\u00f1a. He''s laughing at his stupidity.'), NULL, TIMESTAMP '2020-12-14 15:18:17.34266', TIMESTAMP '2020-12-14 15:18:17.471308'),
