(6560, STRINGDECODE('m\u00e5leffa'), 'muh-lehf-fah', 'vi. to forget; neglect; be unable to recall. Also malefa.', 'From Old Chamorro malefa (to be liberated, to be freed from), from Chamorro passive prefix ma + Proto-Western Malayo-Polynesian lepas (to set free, let loose, liberated).', STRINGDECODE('M\u00e5leffa yu'' ni yabi-hu gi hilo'' lamasa. I forgot my keys on top of the table. Adahi na un maleffa na ti un kand\u00e5lu i petta. Make sure you don''t forget to lock the door.'), NULL, TIMESTAMP '2020-12-14 15:18:17.34266', TIMESTAMP '2020-12-14 15:18:17.471308'),
(6561, STRINGDECODE('m\u00e5leta'), 'muh-leh-tah', 'noun. baggage; suitcase; luggage; trunk (for clothes).', 'From Spanish maleta, meaning "suticase".', STRINGDECODE('Siempre mutta hao yanggen mampos makkat i malet\u00e5-mu. You''ll be fined if your bag is too heavy.'), STRINGDECODE('b\u00e5lisa'), TIMESTAMP '2020-12-14 15:18:17.34266', TIMESTAMP '2020-12-14 15:18:17.471308'),
(6562, STRINGDECODE('m\u00e5linao'), 'muh-lee-nah-oh', 'adjective. calm, still; as in water, ocean, sea, lake.', 'From Proto-Malayo-Polynesian ma-linaw, meaning "calm, still, as the surface of water".', STRINGDECODE('M\u00e5linao i tasi p\u00e5''go. The ocean is calm today.'), NULL, TIMESTAMP '2020-12-14 15:18:17.34266', TIMESTAMP '2020-12-14 15:18:17.471308'),
(6563, STRINGDECODE('m\u00e5linek ulu'), 'muh-lee-nick ooh-loo', 'noun. 1) headache; migraine 2) something or someone that causes trouble or worry.', 'From Old Chamorro malinek (to be shaken) + Chamorro ulu (head)', STRINGDECODE('Ti bai hu h\u00e5nao, sa'' malinek i ilu-hu. I won''t go because I have a headache. Puru ha'' este na guma'' malinek ulu. This house is full of headaches.'), NULL, TIMESTAMP '2020-12-14 15:18:17.34266', TIMESTAMP '2020-12-14 15:18:17.471308'),
(6564, STRINGDECODE('m\u00e5lingu'), 'muh-lee-ngoo', 'adjective. to be lost (unable to be found); to have disappeared; to have vanished; to be missing; deficit.', 'From Chamorro root falingu, to be lost.', STRINGDECODE('M\u00e5lingu i yabi-hu. My keys are lost.'), STRINGDECODE('f\u00e5lingu'), TIMESTAMP '2020-12-14 15:18:17.34266', TIMESTAMP '2020-12-14 15:18:17.471308'),
