(7354, 'neni', 'neh-knee', 'noun. 1) a baby, an infant, a little kid. 2) a term of endearment equivalent to saying "dear","darling","honey" or "sweetie".', 'From Spanish nene, masculine form for baby.', 'Those who are familiar with Spanish may mistakenly assume that the feminine form of this word was also borrowed into Chamorro. This is not the case. The word neni is used for both genders.', STRINGDECODE('p\u00e5tgon'), TIMESTAMP '2020-12-14 15:18:17.34266', TIMESTAMP '2020-12-14 15:18:17.471308'),
